import React, { Component } from 'react'
import Header from '../../Fixed-Components/Header/Header';
import Footer from '../../Fixed-Components/Footer/Footer';
import './home.css';

export default class HomeUI extends Component {
    render() {
        return (

          <>
          <Header></Header>
          <div className="home">
            <div className="first-div">
                <div className="logo">
                    <img></img>
                </div>
                <div className="brief">
                    <p></p>

                </div>
            </div>

          </div>
        
          <Footer></Footer>
          </>
        )
    }
}
